import React from 'react';
import {Router, browserRoute} from 'react-'

import Home from './components/Home'
import Blog from './components/Blog'
import Contact from './components/Contact'

import './App.css';

function App() {
  return (
    <div className="App">
      <Home />
      <Blog />
      <Contact />
    </div>
  );
}

export default App;
